import './Styles/Home.css';


 function  Home () {
  return (
      <div>
      <section class="cover">
            <div class="cover___filter"></div>
                  <div class="cover___text">
                        <h1>Streetwear Brand</h1>
                        <h2>This is the second phrases of the site.</h2>
                        <a href="" class="button">Shop Now</a>
                  </div>
      </section>
      </div>
       
  )
}


export default Home;
